import React from 'react';
import MenuItem from "./MenuItem";

const Menu = ({items}) => {
  return <div className='section-center'>
    <div className='title'>Our menu</div>
    {
      items.map((item) => {
        return <MenuItem key={item.id} {...item}/>
      })
    }
  </div>;
};

export default Menu;
